import '../App.css'
import {Link} from 'react-router-dom'

export const Buscador= ()=>
{
    let valorBuscador='';
    let valorFiltro='';


    return(
        <div className='buscador'>
            <input type='text' className='buscadorInput' onChange={
                (e)=>
                {
                    valorBuscador= e.target.value;
                }
            }/>
            <select type='criterio' className='buscadorCriterio' onChange={
                (e)=>{
                    valorFiltro= e.target.value;
                }
            }>
                <option></option>
                <option>Vivienda</option>
                <option>Renta</option>
            </select>
            <Link to={'/buscar?filter='+valorFiltro+'&value='+valorBuscador}><input type='button'  className='buscarBoton' value={'buscador'} /></Link>
        </div>
    )
}
